Fatherhood has proved a great subject for a variety of artists
some celebratory, some conflicted, but all inspired by what dad 
does and doesn't do. Here's a mixture of songs that celebrate and 
probe the emotional complexities generated by the sometime head 
of the household. Kid Creole and the Coconuts, Cat Stevens
Emmylou Harris, Paul Simon, Madonna, Peter Gabriel, Mike and the 
Mechanics, Suggs and the Blockheads, Neil Young, James Brown, 
Pigbag and even Ozzy Osbourne and his daughter Kelly put in an 
appearance, making a cracking compilation...
